import React from "react";

const Footer = () => {
  return (
    <footer className="footer border z-10 border-t-[#33353F] bg-transparent-200 border-l-transparent border-r-transparent text-black align-items-left flex">
      <div className="container p-12 flex justify-between">
        <span>PORTFOLIO</span>
        <p className="text-slate-600">Thank you!</p>
      </div>
    </footer>
  );
};

export default Footer;
